    <h1 className="colors">List of Five best series</h1>
    <App  imsrc={Array} name="Ali" />
    <App imsrc={Array} name="Ahmad"/>
    <App imsrc={Array} name="Razaq"/>
    <App  imsrc={Array} name="chanda" />
